import Card from "./Card";

const CardList = (props) => {
  return (
    <div>
      <Card
        id={props.robots[0].id}
        name={props.robots[0].name}
        email={props.robots[0].email}
      />
      <Card
        id={props.robots[5].id}
        name={props.robots[5].name}
        email={props.robots[5].email}
      />
      <Card
        id={props.robots[3].id}
        name={props.robots[3].name}
        email={props.robots[3].email}
      />
    </div>
  );
};

export default CardList;
